    render() {
        const showList = (name) => {
            alert(`hello, ${name}`);

            switch(this.state.render) {
                case 'Breakfast': return <Breakfast/>
            }
        }
        return(
            <section className='container'>
                <div className='viewer'>
       
                    <div className='listoflists'>
                        <section className="listoflists">
                        <h1>Shopping Lists</h1>

                            {data.map(listName => (
                                    <p><button onClick={() => showList(listName.name)} >
                                        <GetMockData
                                            key={listName.name}
                                            name={listName.name}
                                        />
                                    </button></p>
                            ))}
                        </section>
                    </div>
                    

                
                </div>
            </section>
        );
    }

}


export default ShoppingListViewer;
